        return new Source("{% extends 'base.html.twig' %}

{% block title %}Symfony Users{% endblock %}

{% block content %}
<div class=\"container\">
    <h1>Register</h1>

    {{ form_start(form, {'attr': {\"novalidate\": \"novalidate\"}}) }}

    <div class=\"form-group\">
        {{ form_label(form.firstName) }}
        {{ form_widget(form.firstName) }}
        {{ form_errors(form.firstName) }}
        {{ form_help(form.firstName) }}
    </div>
    <div class=\"form-group\"> 
        {{ form_label(form.lastName) }}
        {{ form_widget(form.lastName) }}
        {{ form_errors(form.lastName) }}
        {{ form_help(form.lastName) }}
    </div>
    <div class=\"form-group\">
        {{ form_label(form.birthday) }}
        {{ form_widget(form.birthday) }}
        {{ form_errors(form.birthday) }}
        {{ form_help(form.birthday) }}
    </div>
    <div class=\"form-group\">
        {{ form_label(form.email) }}
        {{ form_widget(form.email) }}
        {{ form_errors(form.email) }}
        {{ form_help(form.email) }}
    </div>
    <div class=\"form-group\">
        {{ form_label(form.password) }}
        <br>
        {{ form_label(form.password.first) }}
        {{ form_widget(form.password.first) }}
        <br>
        {{ form_label(form.password.second) }}
        {{ form_widget(form.password.second) }}

        {{ form_errors(form.password) }}
        {{ form_help(form.password) }}
    </div>
    {# <div class=\"form-group\">
        {{ form_label(form.agreeTerms) }}
        {{ form_widget(form.agreeTerms) }}
        {{ form_errors(form.agreeTerms) }}
        {{ form_help(form.agreeTerms) }}
    </div> #}
    <div class=\"text-right mr-5\">
        <button type = \"submit\" class=\"btn btn-xs btn-success\">{{ button_label | default('ajouter un livre') }}</button>
    </div>
</div>


    {{ form_end(form) }}

{% endblock %}", "security/register.html.twig", "/Applications/MAMP/htdocs/Symfony_wf3/firstprojectwf3/templates/security/register.html.twig");
